import HomePage from "./Pages/HomePage"
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router";
function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/">
            <HomePage />
        </Route>
      </Switch>

    </Router>
  );
}

export default App;
